import React from "react";
import "./Footer.css";

const Footer = () => {
    return(
        <div className="footer">
            <h2 style={{paddingBottom: 64, textAlign: "left"}}>Ravi</h2>
            <div className="rwo">
                <div className="column one"></div>
                <div className="column one"></div>
                <div className="column one"></div>
            </div>
        </div>
    )
}

export default Footer
